import React from "react";

const Footer = () => {
  return (
    <footer style={styles.footer}>
      <p>&copy; 2024 Fresh SuperMarket. All rights reserved.</p>
    </footer>
  );
};

const styles = {
  footer: { textAlign: "center", padding: "10px", background: "#f5f5f5", marginTop: "20px" },
};

export default Footer;
